  )
}

function App() {


  return(
    <Router>
      <div>
        <Link to = "/" >Home</Link>
        <Link to = "/about">About</Link>
        <Link to = "/registration">Registration</Link>
        <Link to = "/login">Log in</Link>
        <Switch>
          <Route path = "/" exact>
            <Home />
          </Route>
          <Route path = "/about">
            <About />
          </Route>
          <Route path = "/registration">
            <Registration />
          </Route>
          <Route path = "/login">
            <Login />
          </Route>
          <Route path = "/test"><Test /></Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;

function Home() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

function About(){
  return <h1>About</h1>;
}
